import logo from './logo.svg';
import './App.css';
import {Home} from "./components/Home";
import {Exercise} from "./components/Exercise";
import {Muscle} from "./components/Muscle";
import {BrowserRouter, Route, Switch, NavLink} from "react-router-dom";

function App() {
  return (
    <div className="App container">
      <h3 className="d-flex justify-content-center m-3">React js frontent</h3>
        <nav className="navbar navbar-expand-sm bg-light navbar-dark">
            <ul className="navbar-nav">
                <li className="mav-item- m-1">
                    <NavLink className="btn btn-light btn-outline-primary" to="/home">Home</NavLink>
                </li>
                <li className="mav-item- m-1">
                    <NavLink className="btn btn-light btn-outline-primary" to="/exercise">Exercise</NavLink>
                </li>
                <li className="mav-item- m-1">
                    <NavLink className="btn btn-light btn-outline-primary" to="/muscle">Muscle</NavLink>
                </li>
            </ul>
        </nav>
        <Switch>
            <Route path='/home' component={Home}/>
            <Route path='/muscle' component={Muscle}/>
            <Route path='/exercise' component={Exercise}/>
        </Switch>
    </div>
  );
}

export default App;
